import React from "react";

const Display = (props) => {
  const { currentGeneral } = props;
  if (currentGeneral.length === 0) {
    return <div>No data available</div>;
  }

  return (
    <div>
      {/* Display the values from the infoList array */}
      {currentGeneral.map((info, index) => (
        <div key={index}>
          <p>Name: {info.name}</p>
          <p>Email: {info.email}</p>
          <p>Phone: {info.phone}</p>
          <p>City: {info.city}</p>
          {/* Add additional fields as needed */}
        </div>
      ))}
    </div>
  );
};

export default Display;
